module.exports = {

    rules: {

        // 1 No hardcoded waits (e.g., browser.pause(5000))

        'no-hardcoded-waits': {

            create: function (context) {

                return {

                    CallExpression(node) {

                        if (

                            node.callee.property &&

                            node.callee.property.name === 'pause' &&

                            node.arguments.length &&

                            node.arguments[0].type === 'Literal'

                        ) {

                            context.report(node, 'Avoid using hardcoded waits. Use explicit waits instead.');

                        }

                    },

                };

            },

        },

        // 2 No duplicate test names in Mocha/Jest

        'no-duplicate-test-names': {

            create: function (context) {

                const testNames = new Set();

                return {

                    CallExpression(node) {

                        if (node.callee.name === 'it' || node.callee.name === 'test') {

                            const testName = node.arguments[0]?.value;

                            if (testNames.has(testName)) {

                                context.report(node, `Duplicate test name found: "${testName}". Test names should be unique.`);

                            }

                            testNames.add(testName);

                        }

                    },

                };

            },

        },

        // 3 No direct selectors (use page objects instead)

        'no-direct-selectors': {

            create: function (context) {

                return {

                    Literal(node) {

                        if (typeof node.value === 'string' && node.value.match(/(\.|#)[a-zA-Z0-9_-]+/)) {

                            context.report(node, 'Avoid using direct selectors. Use page object methods instead.');

                        }

                    },

                };

            },

        },

        // 4 Require at least one assertion in every test

        'require-assertions': {

            create: function (context) {

                return {

                    CallExpression(node) {

                        if (node.callee.name === 'it' || node.callee.name === 'test') {

                            const body = node.arguments[1]?.body;

                            if (

                                body &&

                                body.body &&

                                !body.body.some((statement) => statement.type === 'ExpressionStatement' && statement.expression.callee)

                            ) {

                                context.report(node, 'Each test must contain at least one assertion.');

                            }

                        }

                    },

                };

            },

        },

    },

};

import js from '@eslint/js';

export default [
    js.configs.recommended, // Extends recommended ESLint rules
    {
        plugins: {
            'custom-rules': {
                rules: {
                    'no-hardcoded-waits': {
                        meta: {
                            type: 'problem',
                            docs: {
                                description: 'Disallow hardcoded waits in tests',
                            },
                        },
                        create: function (context) {
                            return {
                                CallExpression(node) {
                                    if (node.callee.name === 'browser.pause') {
                                        context.report({ node, message: 'Avoid hardcoded waits (browser.pause)' });
                                    }
                                },
                            };
                        },
                    },
                    'no-duplicate-test-names': {
                        meta: {
                            type: 'problem',
                            docs: {
                                description: 'Disallow duplicate test names',
                            },
                        },
                        create: function (context) {
                            const testNames = new Set();
                            return {
                                CallExpression(node) {
                                    if (
                                        node.callee.name === 'it' ||
                                        node.callee.name === 'test' ||
                                        node.callee.name === 'describe'
                                    ) {
                                        const testName = node.arguments[0] && node.arguments[0].value;
                                        if (testName && testNames.has(testName)) {
                                            context.report({ node, message: `Duplicate test name detected: "${testName}"` });
                                        }
                                        testNames.add(testName);
                                    }
                                },
                            };
                        },
                    },
                    'no-direct-selectors': {
                        meta: {
                            type: 'problem',
                            docs: {
                                description: 'Disallow direct CSS/XPath selectors in test scripts',
                            },
                        },
                        create: function (context) {
                            return {
                                Literal(node) {
                                    if (typeof node.value === 'string' && (node.value.includes('//') || node.value.includes('#'))) {
                                        context.report({
                                            node,
                                            message: 'Avoid using direct CSS/XPath selectors. Use page object locators instead.',
                                        });
                                    }
                                },
                            };
                        },
                    },
                    'require-assertions': {
                        meta: {
                            type: 'problem',
                            docs: {
                                description: 'Ensure at least one assertion is present in each test',
                            },
                        },
                        create: function (context) {
                            let hasAssertion = false;
                            return {
                                CallExpression(node) {
                                    if (
                                        node.callee.name === 'expect' ||
                                        node.callee.name === 'assert' ||
                                        node.callee.name === 'chai'
                                    ) {
                                        hasAssertion = true;
                                    }
                                },
                                'Program:exit': function (node) {
                                    if (!hasAssertion) {
                                        context.report({
                                            node,
                                            message: 'Each test must have at least one assertion.',
                                        });
                                    }
                                },
                            };
                        },
                    },
                },
            },
        },
        rules: {
            'custom-rules/no-hardcoded-waits': 'error',
            'custom-rules/no-duplicate-test-names': 'error',
            'custom-rules/no-direct-selectors': 'error',
            'custom-rules/require-assertions': 'error',
        },
    },
];

const { $ } = require('@wdio/globals')
const Page = require('./page');

/**
 * sub page containing specific selectors and methods for a specific page
 */
class LoginPage extends Page {
    /**
     * define selectors using getter methods
     */
    get inputUsername () {
        return $('#username');
    }

    get inputPassword () {
        return $('#password');
    }

    get btnSubmit () {
        return $('button[type="submit"]');
    }

    /**
     * a method to encapsule automation code to interact with the page
     * e.g. to login using username and password
     */
    async login (username, password) {
        await this.inputUsername.setValue(username);
        await this.inputPassword.setValue(password);
        await this.btnSubmit.click();
    }

    /**
     * overwrite specific options to adapt it to page object
     */
    open () {
        return super.open('login');
    }
}

module.exports = new LoginPage();

